import EmployeeListPage from './Login/EmployeeListPage'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {

    }
  }

  render() {
    const NotFoundRedirect = () => <Redirect to='/loginscreen' />

    return (
      <div className="App">
        <header className="App-header">
          <>
            <p>
              Welcome to Appiness.
            </p>
            {/* <div  className="col-md-12">
              <LoginScreen />
            </div> */}
            <BrowserRouter>
              <Switch>
                <Route component={NotFoundRedirect} />
                <Route exact path='/loginscreen' component={LoginScreen} />
              </Switch>
            </BrowserRouter>
          </>
        </header>

        {/* <BrowserRouter>
          <div className="App">
            <Switch>
              <Route path="manageEmployees" component={EmployeeListPage} />
            </Switch>
          </div>
        </BrowserRouter> */}
      </div>
    );
  }
}

export default (App);
